DECLARE
	@BinaryFileId int
	,@BinaryFileTypeIdDefault int = (SELECT TOP 1 Id from [BinaryFileType] where [Guid] = 'C1142570-8CD6-4A20-83B1-ACB47C1CD377')
	,@StorageEntityTypeIdDatabase int = (SELECT TOP 1 Id FROM [EntityType] WHERE [Guid] = '0AA42802-04FD-4AEC-B011-FEB127FC85CD')

-- Add RockSolidChurchLogo.svg
IF NOT EXISTS (SELECT * FROM [BinaryFile] WHERE [Guid] = 'E153E57F-08A4-4AEC-8A54-BF4211ACB127' )
BEGIN
	INSERT INTO [BinaryFile] ([IsTemporary], [IsSystem], [BinaryFileTypeId], [FileName], [MimeType], [StorageEntityTypeId], [Guid])
				VALUES (0,0, @BinaryFileTypeIdDefault, 'RockSolidChurchLogo.svg', 'image/svg+xml', @StorageEntityTypeIdDatabase, 'E153E57F-08A4-4AEC-8A54-BF4211ACB127')

	SET @BinaryFileId = SCOPE_IDENTITY()

	INSERT INTO [BinaryFileData] ([Id], [Content], [Guid])
	  VALUES ( 
		@BinaryFileId
		,
		,'b31fa6f3-81e5-406d-b000-01038760b796')

	UPDATE [Site]
	SET
		[SiteLogoBinaryFileId]=@BinaryFileId
	WHERE
		[Guid]='11E449C7-CCC8-4C24-B280-FA5363C8F554'
END
	
-- Add RockSolidRSquare.png
IF NOT EXISTS (SELECT * FROM [BinaryFile] WHERE [Guid] = '86855D09-1C38-4D8F-AFFD-ECEBD35D11CB' )
BEGIN
	INSERT INTO [BinaryFile] ([IsTemporary], [IsSystem], [BinaryFileTypeId], [FileName], [MimeType], [StorageEntityTypeId], [Guid])
				VALUES (0,0, @BinaryFileTypeIdDefault, 'RockSolidRSquare.png', 'image/png', @StorageEntityTypeIdDatabase, '86855D09-1C38-4D8F-AFFD-ECEBD35D11CB')

	SET @BinaryFileId = SCOPE_IDENTITY()

	INSERT INTO [BinaryFileData] ([Id], [Content], [Guid])
	  VALUES ( 
		@BinaryFileId
		,
		,'b4957a09-a8c1-4055-8f48-49b1e2b19520')

	UPDATE [Site]
	SET
		[FavIconBinaryFileId]=@BinaryFileId
	WHERE
		[Guid]='11E449C7-CCC8-4C24-B280-FA5363C8F554'
END